import React, { Component } from 'react';
import NavigationItems from '../../components/UI/Navigation/NavigationItems/NavigationItems';

class Layout extends Component {
	render() {
		return (
			<React.Fragment>
				<NavigationItems />
			</React.Fragment>
		);
	}
}
export default Layout;
